import {FaInstagram, FaSpotify} from 'react-icons/fa'

function Footer() {



    return (
        <div>
            <FaInstagram onClick={() => window.open('https://www.instagram.com/moonsoulmusic/')} />
            <FaSpotify onClick={() => window.open('https://open.spotify.com/artist/7JJCj4PwTmJZdg53Z1Qznl')} />
        </div>
    )
}

export default Footer;
